from typing import List

from tqdm import tqdm


class Solution:
    def trap(self, height: List[int]) -> int:
        result = 0
        for index, v in tqdm(enumerate(height[:-1]), total=len(height[:-1])):
            if index == 0:
                continue
            left_max = max(height[:index])
            right_max = max(height[index + 1:])
            num = min(left_max, right_max) - v
            result += (num if num > 0 else 0)

        return result


